import { Button, GetPosts, UpdatePost } from '../conponents';
import '../scss/app.scss'

function Home() {
    return (
        <div className='home'>
            <div className='home-header'>
                <h1>Tell me</h1>
                <p>Hi! Here you may write posts about your life, your dreams and share your purpose!!! <br /> Also you may read it about other people... Have a nice tripe in our world!</p>

                <div>
                    <Link to='login'><Button className='button-home'>Login</Button></Link> <span>or</span> <Link to='/signup'><Button className='button-home'>Register</Button></Link>
                </div>

                <Link to=''><img className='arrow'>&#10094;</img></Link>
            </div>
            <div className='home-content'>
            <GetPosts />

            {/* <NavLink to={'/login'}>Login</NavLink><br/>
            <NavLink to={'/signup'}>signup</NavLink> */}
            </div>
        </div>
    )
}


export default Home;
